import React, { useState } from 'react';
import { View, TextInput, Button, Text } from 'react-native';

const LoginForm = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [securityQuestion1, setSecurityQuestion1] = useState('');
    const [securityQuestion2, setSecurityQuestion2] = useState('');
    const [securityQuestion3, setSecurityQuestion3] = useState('');

    const handleLogin = () => {
        // Here, you can perform any logic to save the user's information
        // For simplicity, let's just log the values to the console
        console.log('First Name:', firstName);
        console.log('Last Name:', lastName);
        console.log('Security Question 1:', securityQuestion1);
        console.log('Security Question 2:', securityQuestion2);
        console.log('Security Question 3:', securityQuestion3);
    };

    return (
        <View style={{ flex: 1, padding: 16 }}>
            <Text style={{ fontSize: 25, fontWeight: 'bold', marginBottom: 16 }}>
                Login Page
            </Text>
            <TextInput
                style={{ marginBottom: 8 }}
                placeholder="First Name"
                onChangeText={text => setFirstName(text)}
                value={firstName}
            />
            <TextInput
                style={{ marginBottom: 8 }}
                placeholder="Last Name"
                onChangeText={text => setLastName(text)}
                value={lastName}
            />
            <TextInput
                style={{ marginBottom: 8 }}
                placeholder="Security Question 1"
                onChangeText={text => setSecurityQuestion1(text)}
                value={securityQuestion1}
            />
            <TextInput
                style={{ marginBottom: 8 }}
                placeholder="Security Question 2"
                onChangeText={text => setSecurityQuestion2(text)}
                value={securityQuestion2}
            />
            <TextInput
                style={{ marginBottom: 16 }}
                placeholder="Security Question 3"
                onChangeText={text => setSecurityQuestion3(text)}
                value={securityQuestion3}
            />
            <Button onPress={handleLogin} title="Login" />
        </View>
    );
};

export default LoginForm;
